<template>
    <h1>{{ rank }} 목록 출력!</h1>
    <h1 v-for="(phone, index) in phones" :key="index">{{ phone.name }}
        <br/>
        <img :src=phone.img alt="이미지"/>
    </h1>
    <hr/>
</template>

<script>
export default {
    props:['rank'],
    data() {
        return {
            used: [{name:"리퍼 아이폰", img:"data:image/jpeg;base64,"}, {name:"리퍼 갤럭시", img: "data:image/jpeg;base64,"}],
            new: [{name:"s급 아이폰",img:"data:image/jpeg;base64,"}, {name:"s급 갤럭시",img:"data:image/jpeg;base64,"}],
        }
    },
    computed: {
        phones() {
            return this.rank.includes("리퍼") ? this.used : this.new;
        }
    }
}
</script>

